//straight_k = (double)(xx1*xx1+xx2*xx2+xx3*xx3-(xx1+xx2+xx3)*(xx1+xx2+xx3)/3)/(double)(xx1*yy1+xx2*yy2+xx3*yy3-(xx1+xx2+xx3)*(yy1+yy2+yy3)/3);
  straight_k=0;
  uint8 half_x=(xx1+xx3)/2;
  uint8 half_y=(yy1+yy3)/2;
  if(abs(half_x-midline[half_y])<=straight_error&&abs(xx3-xx1)<=straight_k_error&&(!enable_loop_flag))
  {
    straight_road_end=10; 
  }
