void midline_search()//普通中线
{ 
  wide=0;
  left_edge_sum=0;
  right_edge_sum=0;
  mid_temp_row=-1;
  ///////////////////////////这里是局部变量////////////////////////////////
  
  memset(mid_down_pot,-1,sizeof(mid_down_pot));
  double xxx,yyy;         //逆透视中线坐标
  double x_angle,y_angle; //离边沿的竖直、水平偏移
  double xx1,yy1,xx2,yy2,xx3,yy3;  //边沿逆透视坐标//////////xxx,为纵坐标，yyy横坐标
  uint8 mid_line_row;//补中线行循环
  double uSrcImg,vSrcImg; //反逆透视坐标   
  double k=0;//定义斜率
  
  
  ////////////////////////////////////////补中线-开始---刘耀岳
  for(mid_line_row=CAMERA_H-1;mid_line_row>0;mid_line_row--)
  {
    
    if(left_edge[mid_line_row]!=-1 && right_edge[mid_line_row]!=-1)//普通补线
    {  
      midline[mid_line_row]=round((left_edge[mid_line_row]+right_edge[mid_line_row])/2);////////存储中线
      //        img_barrel[mid_line_row][ midline[mid_line_row]]=0;
      //        img_barrel[mid_line_row][ midline[mid_line_row]-1]=0;
      //        img_barrel[mid_line_row][ midline[mid_line_row]+1]=0;
      //      
      left_edge_sum++;
      right_edge_sum++;
      mid_temp_row=-1;
      midline_cnt++;
      row_mid=mid_line_row;
       if( DIP0==1 )
  {
      img_data[mid_line_row][left_edge[mid_line_row]+4]=0;
      img_data[mid_line_row][left_edge[mid_line_row]+5]=0;
      img_data[mid_line_row][left_edge[mid_line_row]+3]=0;
      
      img_data[mid_line_row][right_edge[mid_line_row]-3]=0;
      img_data[mid_line_row][right_edge[mid_line_row]-5]=0;
      img_data[mid_line_row][right_edge[mid_line_row]-4]=0;       
      //        img_barrel[mid_line_row][left_edge[mid_line_row]+1]=0;
      //        img_barrel[mid_line_row][left_edge[mid_line_row]+2]=0;
      //        img_barrel[mid_line_row][left_edge[mid_line_row]]=0;
      //        
      //        img_barrel[mid_line_row][right_edge[mid_line_row]+1]=0;
      //        img_barrel[mid_line_row][right_edge[mid_line_row]+2]=0;
      //        img_barrel[mid_line_row][right_edge[mid_line_row]]=0;       
  }
      
    }
    if(left_edge[mid_line_row]!=-1 && right_edge[mid_line_row]==-1)//只有左边沿
    {    
      //         if(L_ren_flag==1)
      //         {
      //           wide=65;
      //         }
      left_edge_sum++;
       if( DIP0==1 )
  {
      img_data[mid_line_row][left_edge[mid_line_row]+4]=0;
      img_data[mid_line_row][left_edge[mid_line_row]+5]=0;
      img_data[mid_line_row][left_edge[mid_line_row]+3]=0;
  }
      if( inv_left_edge[mid_line_row+ROW_INTERVAL].x!=-1 && inv_left_edge[mid_line_row].x!=-1 && inv_left_edge[mid_line_row-ROW_INTERVAL].x!=-1 )
      {    
        xx1=inv_left_edge[mid_line_row+ROW_INTERVAL].x;
        yy1=inv_left_edge[mid_line_row+ROW_INTERVAL].y;
        xx2=inv_left_edge[mid_line_row].x;
        yy2=inv_left_edge[mid_line_row].y;
        xx3=inv_left_edge[mid_line_row-ROW_INTERVAL].x;
        yy3=inv_left_edge[mid_line_row-ROW_INTERVAL].y;
        /*最小二乘法获取边沿法线斜率，平移赛道宽度一半*/
        k = (-1.0)*(xx1*yy1+xx2*yy2+xx3*yy3-(xx1+xx2+xx3)*(yy1+yy2+yy3)/3)/(xx1*xx1+xx2*xx2+xx3*xx3-(xx1+xx2+xx3)*(xx1+xx2+xx3)/3);
        if((L_ren_flag==1||L_ren_flag==2))  //只要是一二阶段，都这样处理
        {
          k=0;
        }
        if(L_ren_flag==4||R_ren_flag==4)
        {
          wide=70;
        }
        else
        {
          wide=90;
        }
        if((k==0)|| (isnan(k)==1) || (isnan(k)==-1))  //水平
        {
          xxx=xx2;
          yyy=yy2+wide;
        }
        else if((isinf(k)==1) || (isinf(k)==-1))     //垂直
        {
          xxx=xx2-wide;
          yyy=yy2;
        }
        else
        {
          y_angle=wide/sqrtf(1+k*k);   //离边沿的水平偏移
          x_angle=y_angle*fabsf(k);        //离边沿的竖直偏移
          if(k>0)
          {
            xxx=xx2+x_angle;
            yyy=yy2+y_angle;
          }
          if(k<0)
          {
            xxx=xx2-x_angle;
            yyy=yy2+y_angle;
          }
        }
        /*反逆透视*/
        uSrcImg =(INV_B*INV_F - INV_C*INV_E + INV_E*yyy - INV_B*xxx - INV_F*INV_H*yyy + INV_C*INV_H*xxx)/(INV_A*INV_E - INV_B*INV_D + INV_D*INV_H*yyy - INV_E*INV_G*yyy - INV_A*INV_H*xxx + INV_B*INV_G*xxx);
        vSrcImg =-(INV_A*INV_F - INV_C*INV_D + INV_D*yyy - INV_A*xxx - INV_F*INV_G*yyy + INV_C*INV_G*xxx)/(INV_A*INV_E - INV_B*INV_D + INV_D*INV_H*yyy - INV_E*INV_G*yyy - INV_A*INV_H*xxx + INV_B*INV_G*xxx);
        
        mid_x=round(vSrcImg-1);
        mid_y=round(uSrcImg-1);

        if( mid_temp_row==-1 )   //第一次中线断点
        {
          if( mid_x>=ROW_START && mid_x>=mid_line_row-10 )//逆透视在正常范围内  20要改
          {
            if( mid_x<=ROW_END )/////底部以上<CAMERA_H
            {
              if( mid_y>=COL_START && mid_y<=COL_END )//在正常范围内
              {
                midline[mid_x]=mid_y;
                midline_cnt++;
                mid_temp_row=mid_x;
              }
            }
            else//大于camera_hl了。。。出下界了
            {
              if( mid_y>=COL_START && mid_y<=COL_END && mid_x<=ROW_END+10 )//比底部再近10行
              {
                if( mid_down_pot[0]==-1 )
                {
                  mid_down_pot[0]=mid_x;
                  mid_down_pot[1]=mid_y;
                }
                else
                {
                  if( mid_x<=mid_down_pot[0] )
                  {
                    mid_down_pot[0]=mid_x;
                    mid_down_pot[1]=mid_y;
                  }
                }
              }
            }
          }
        }
        else//非第一个像素点
        {
          if( mid_x>=ROW_START && mid_x<=ROW_END && mid_x>=mid_temp_row-10 && mid_x<=mid_temp_row+10 )//在上一次反逆透视的基础上对x进行筛选
          {
            if( mid_y>=COL_START && mid_y<=COL_END )//在图像左右的正常范围内
            {
              if( mid_y>=midline[mid_temp_row]-3 )//在正常范围内
              {
                midline[mid_x]=mid_y;
                midline_cnt++;
                mid_temp_row=mid_x;
              }
            }
            else
            {
              if( mid_y<=COL_END+20 )
              {
                if( mid_y>=midline[mid_temp_row]-3 )
                {
                  midline[mid_x]=COL_END;
                  midline_cnt++;
                  mid_temp_row=mid_x;
                }
              }
            }
          }
        }
        
        
      }
      
    }
    
    if(left_edge[mid_line_row]==-1&&right_edge[mid_line_row]!=-1)//只有右边沿
    {
      
      right_edge_sum++;
       if( DIP0==1 )
  {
      img_data[mid_line_row][right_edge[mid_line_row]-3]=0;
      img_data[mid_line_row][right_edge[mid_line_row]-5]=0;
      img_data[mid_line_row][right_edge[mid_line_row]-4]=0;      
  }
      //         if(R_ren_flag==1)
      //         {
      //           wide=65;
      //         }
      if((mid_line_row+ROW_INTERVAL)<CAMERA_H&&(mid_line_row-ROW_INTERVAL)>0)
      {   
        if(inv_right_edge[mid_line_row+ROW_INTERVAL].x!=-1 && inv_right_edge[mid_line_row].x!=-1 && inv_right_edge[mid_line_row-ROW_INTERVAL].x!=-1 )
        {
          xx1=inv_right_edge[mid_line_row+ROW_INTERVAL].x;
          yy1=inv_right_edge[mid_line_row+ROW_INTERVAL].y;
          xx2=inv_right_edge[mid_line_row].x;
          yy2=inv_right_edge[mid_line_row].y;
          xx3=inv_right_edge[mid_line_row-ROW_INTERVAL].x;
          yy3=inv_right_edge[mid_line_row-ROW_INTERVAL].y;
          
          /*最小二乘法获取边沿法线斜率，平移赛道宽度一半*/
          k=(-1.0)*(xx1*yy1+xx2*yy2+xx3*yy3-(xx1+xx2+xx3)*(yy1+yy2+yy3)/3)/(xx1*xx1+xx2*xx2+xx3*xx3-(xx1+xx2+xx3)*(xx1+xx2+xx3)/3);
          if((R_ren_flag==1||R_ren_flag==2))
          {
            k=0;
          }
          if(L_ren_flag==4||R_ren_flag==4)
          {
            wide=70;
          }
          else
          {
            wide=90;
          }
          if( k==0 || (isnan(k)==1) || (isnan(k)==-1) )  //水平
          {
            xxx=xx2;
            yyy=yy2-wide;
          }
          else if( (isinf(k)==1) || (isinf(k)==-1) )  //垂直
          {
            xxx=xx2-wide;
            yyy=yy2;
          }        
          else
          {
            y_angle=wide/sqrtf(1+k*k); //离边沿的水平偏移
            x_angle=y_angle*fabsf(k);      //离边沿的竖直偏移
            if(k>0)
            {
              xxx=xx2-x_angle;
              yyy=yy2-y_angle;
            }
            if(k<0)
            {
              xxx=xx2+x_angle;
              yyy=yy2-y_angle;
            }
          }
          
          /*反逆透视*/
          uSrcImg =(INV_B*INV_F - INV_C*INV_E + INV_E*yyy - INV_B*xxx - INV_F*INV_H*yyy + INV_C*INV_H*xxx)/(INV_A*INV_E - INV_B*INV_D + INV_D*INV_H*yyy - INV_E*INV_G*yyy - INV_A*INV_H*xxx + INV_B*INV_G*xxx);
          vSrcImg =-(INV_A*INV_F - INV_C*INV_D + INV_D*yyy - INV_A*xxx - INV_F*INV_G*yyy + INV_C*INV_G*xxx)/(INV_A*INV_E - INV_B*INV_D + INV_D*INV_H*yyy - INV_E*INV_G*yyy - INV_A*INV_H*xxx + INV_B*INV_G*xxx);
          
          mid_x=round(vSrcImg-1);
          mid_y=round(uSrcImg-1);
          //                             if(mid_x>=0&&mid_x<=CAMERA_H&&mid_y>0&&mid_y<CAMERA_W)
          //                               midline[mid_x]=mid_y;
          //                             if(mid_y<0)
          //                               midline[mid_x]=CAMERA_W;
          if( mid_temp_row==-1 )//第一次进入
          {
            if( mid_x>=ROW_START && mid_x<=ROW_END && mid_x>=mid_line_row-20 )//20
            {
              if( mid_x<=ROW_END )
              {
                if( mid_y>=COL_START && mid_y<=COL_END )//在正常范围内
                {
                  midline[mid_x]=mid_y;
                  midline_cnt++;
                  mid_temp_row=mid_x;//记录第一个点此次行值
                }
              }
              else//mid_x不在正常范围内   在图像下边10行
              {
                if( mid_y>=COL_START && mid_y<=COL_END && mid_x<=ROW_END+10 )
                {
                  if( mid_down_pot[0]==-1 )
                  {
                    mid_down_pot[0]=mid_x;
                    mid_down_pot[1]=mid_y;//记录图像最下方点
                  }
                  else
                  {
                    if( mid_x<=mid_down_pot[0] )
                    {
                      mid_down_pot[0]=mid_x;
                      mid_down_pot[1]=mid_y;//更新逆透视图像最下方点
                    }
                  }
                }
              }
            }
          }
          else//非第一次进入
          {
            if( mid_x>=ROW_START && mid_x<=ROW_END && mid_x>=mid_temp_row-10 && mid_x<=mid_temp_row+10 )///30       3 
            {
              if( mid_y>=COL_START && mid_y<=COL_END )//像素点在图像正常范围内
              {
                if( mid_y<=midline[mid_temp_row]+3 )//和上个点相比的位置正常
                {
                  midline[mid_x]=mid_y;
                  midline_cnt++;
                  mid_temp_row=mid_x;
                }
              }
              else
              {
                if( mid_y>=COL_START-20 )//图像超过左边界-20
                {
                  if( mid_y<=midline[mid_temp_row]+3 )
                  {
                    midline[mid_x]=COL_START;//赋予最左边；
                    midline_cnt++;
                    mid_temp_row=mid_x;
                  }
                }
              }
            }
          }
          
        }
        
      }
    } 
    
    
    ///////////////////////////////////结束
    
    
  }
  
  if( row_mid!=-1 )//如果最近行有值
  {
    if( mid_temp_row!=-1 )
    {
      if( row_mid<mid_temp_row )    //row_mid两边都有线的最远行
      {
        mid_temp_row=row_mid;//普通中线和逆透视中线重合时采用普通中线
      }
    }
    else
    {
      mid_temp_row=row_mid;
    }
  }
}
