void midline_bu()                     //中线补断点函数（用于中间离散中线）
{
  int16 x,i,xx;    //循环变量
  int16 mid_down=-1,mid_up=-1,mid;   //中线上下离散点行值
  double mid_row,mid_col,mid_start; //斜率计算变量
  
  midlinebu_row=MID_ADD;             //设定断线处补线范围最大范围
  
  
  for( x=ROW_END ; x>=mid_temp_row ; x-- )   //搜索中线，完成补线从camera_h开始到   之前逆透视最远的点
  {         
    if( midline[x]!=-1 )//有中线
    {
      mid_down=x;             //则记录
    }
    else//没中线
    {
      if( mid_down!=-1 )//出现过中线
      {
        for( i=x-1 ; i>=mid_temp_row ; i-- )   //向远处搜索中线
        {
          if( midline[i]!=-1 )//找到远处的话
          {
            mid_up=i;   //记录远处的
            break;
          }
        }
        if( mid_up==-1 )//没找到上边那点
        {
          break;   //搜索不到中线，则结束补线
        }
        else//找到上边那点了
        {
          if( inv_distance[mid_up]-inv_distance[mid_down]<midlinebu_row )  //当搜索得到上中线，且在范围内，进行补线   midlinebu_row待定
          {
            mid_row=mid_down-mid_up;//作差
            mid_col=midline[mid_down]-midline[mid_up];//作差
            mid_col=mid_col/mid_row;                                         //牛逼    求K
            mid_start=midline[mid_down];
            for( xx=mid_down-1 ; xx>mid_up ; xx-- )
            {
              mid_start=mid_start-mid_col;//y=-kx+b; x=1
              mid=round(mid_start);
              midline[xx]=mid;
              midline_cnt++;
            }
            mid_down=mid_up;
            x=mid_up+1;//记录此时的找到的远处的点
            mid_up=-1;
          }
          else   //当搜索搜索得到上中线，不在范围内，放弃补线
          {
            x=mid_up+1;
            mid_down=mid_up;
            mid_up=-1;
          }
        }
      }
    }
  }
  
  mid_down=-1;
  for( x=ROW_END ; x>ROW_END-MID_BOTTOM_row ; x-- )   //搜索中线，完成底部补线
  {
    if( midline[x]!=-1 )//在MID_BOTTOM_row内有线
    {
      if( x==ROW_END )
      {
        break;//底部开始就有线退出补线；
      }
      else//不是从最底部有线
      {
        if( mid_down_pot[0]==-1 )    //一开始就没有未搜索到图像外下方点
        {
          mid_down=x;
          mid_up=0;
          for( x=mid_down-1 ; x>=mid_down-6 ; x-- )   //搜索中线，完成底部补线
          {
            if( midline[x]!=-1 )//有中线
            {
              mid_up++;
            }
            else
            {
              break;
            }
          }
          if( mid_up>=6 )
          {
            mid_row=6;
            mid_col=midline[mid_down]-midline[mid_down-6];//作差
            mid_col=mid_col/mid_row;//求k;;
            if( fabsf(mid_col)>1 )
            {
              if( mid_col<0 )
              {
                mid_col=-1;
              }
              else
              {
                mid_col=1;
              }
            }
            
            mid_start=midline[mid_down-3];
            for( xx=mid_down-2 ; xx<=ROW_END ; xx++ )//把底部连起来
            {
              mid_start=mid_start+mid_col;
              mid=round(mid_start);
              if( mid<COL_START || mid>COL_END )
              {
                if( mid<COL_START )
                {
                  for( i=xx ; i<=ROW_END ; i++ )
                  {
                    midline[xx]=COL_START;
                    midline_cnt++;
                  }
                }
                else
                {
                  for( i=xx ; i<=ROW_END ; i++ )
                  {
                    midline[xx]=COL_END;
                    midline_cnt++;
                  }
                }
                break;
              }
              midline[xx]=mid;
              midline_cnt++;
            }
            break;//补完线了
          }
        }
        else    //搜索到图像外下方点
        {
          mid_row=mid_down_pot[0]-x;
          mid_col=mid_down_pot[1]-midline[x];
          mid_col=mid_col/mid_row;
          mid_start=midline[x];
          for( xx=x+1 ; xx<=ROW_END ; xx++ )
          {
            mid_start=mid_start+mid_col;
            mid=round(mid_start);
            if( mid<COL_START || mid>COL_END )
            {
              if( mid<COL_START )
              {
                for( i=xx ; i<=ROW_END ; i++ )
                {
                  midline[xx]=COL_START;
                  midline_cnt++;
                }
              }
              else
              {
                for( i=xx ; i<=ROW_END ; i++ )
                {
                  midline[xx]=COL_END;
                  midline_cnt++;
                }
              }
              break;
            }
            midline[xx]=mid;
            midline_cnt++;
          }
          break;
        }
      }
    }
  }
  
  //      if( mid_temp_row!=-1 )
  //      {
  //            mid_down=mid_temp_row;//记录的中线末尾行值
  //            for( x=mid_temp_row+1 ; x<=ROW_END ; x++ )   //搜索中线，完成中间丢失中线赋值
  //            {
  //                  if( midline[x]==-1 )
  //                  {
  //                        if( midline[mid_down]<=50 && left_edge[x]==-1 )
  //                        {
  //                              midline[x]=COL_START;
  //                              mid_down=x;
  //                        }
  //                        if( midline[x-1]>=110 && right_edge[x]==-1 )
  //                        {
  //                              midline[x]=COL_END;
  //                              mid_down=x;
  //                        }
  //                  }
  //                  else
  //                  {
  //                        mid_down=x;
  //                  }
  //            }
  //      }
  
  
}


