void midline_bu_end()                 //中线补断点函数（用于补弯道末尾中线）
{
  mid_end_jizhun_flag=0;
  if(right_curve_flag)
  {
    for(int16 j= COL_END ;j>= COL_END-40;j--)//20要改
    {
      midline_jizhun_search(j);
      if( mid_end_jizhun_flag)
      {
        break;
      }
    }
  //inv_mid_end=get_inv_img(mid_end_jizhun.x ,mid_end_jizhun.y);
  //  inv_mid_end.x=mid_inv_form_x[mid_end_jizhun.x][mid_end_jizhun.y]-((1.0*2*wide+(inv_distance[mid_end_jizhun.x])/20)/2);
 //    inv_mid_end.y=mid_inv_form_y[mid_end_jizhun.x][mid_end_jizhun.y];
  //  mid_end=get_invinv_img(inv_mid_end.x,inv_mid_end.y);
   // mid_end.x=mid_end_jizhun.x;
 //   mid_end.y=mid_end_jizhun.y;
        inv_mid_end=get_inv_img(mid_end_jizhun.x ,mid_end_jizhun.y);
    inv_mid_end.x=inv_mid_end.x-((1.0*2*wide+(inv_distance[mid_end_jizhun.x])/20)/2);
    mid_end=get_invinv_img(inv_mid_end.x,inv_mid_end.y);
 
    
  }
  else  if(left_curve_flag)
  {
    for(int16 j= 0 ;j<= 40;j++)
    {
      midline_jizhun_search(j);
      if( mid_end_jizhun_flag)
      {
        break;
      }
    }
 //  inv_mid_end=get_inv_img(mid_end_jizhun.x ,mid_end_jizhun.y);
 //inv_mid_end.x=mid_inv_form_x[mid_end_jizhun.x][mid_end_jizhun.y]-((1.0*2*wide+(inv_distance[mid_end_jizhun.x])/20)/2);
// inv_mid_end.y=mid_inv_form_y[mid_end_jizhun.x][mid_end_jizhun.y];
//    mid_end=get_invinv_img(inv_mid_end.x,inv_mid_end.y);
//    mid_end.x=mid_end_jizhun.x;
  //  mid_end.y=mid_end_jizhun.y;
        inv_mid_end=get_inv_img(mid_end_jizhun.x ,mid_end_jizhun.y);
    inv_mid_end.x=inv_mid_end.x-((1.0*2*wide+(inv_distance[mid_end_jizhun.x])/20)/2);
    mid_end=get_invinv_img(inv_mid_end.x,inv_mid_end.y);
 
  }
  if( mid_end_jizhun_flag)
  {
    double line_k,line_b;
    int16 mid_x,mid_y;
    line_k=(1.0)*(midline[mid_temp_row]-mid_end.y)/(mid_temp_row-mid_end.x);
    line_b=(-1.0)*(midline[mid_temp_row]-mid_end.y)/(mid_temp_row-mid_end.x)*mid_end.x + mid_end.y;
    for(int16 i = mid_temp_row;i>= mid_end.x;i--)
    {
      mid_x=i;
      mid_y =round( line_k *mid_x + line_b);
      if(( mid_x >=ROW_START) && (mid_x <= ROW_END) && (mid_y>=COL_START) && (mid_y <= COL_END))
      {
        if(midline[mid_x+1]>=mid_y&&left_curve_flag)
        {
          midline[mid_x]=mid_y;          
        }
        else if(midline[mid_x+1]<=mid_y&&right_curve_flag)
        {
          midline[mid_x]=mid_y;        
        }
        //mid_temp_row=mid_x;            
      }
    }
  }
}


