void midline_jizhun_search(int16 i)   //基准中线搜索函数    中线最远端
{
  //找基准
  for(int16 ii=10;ii<CAMERA_H;ii++)//找到最右边那个点
  {
    if(img_barrel[ii][i]<=img_threshold&&img_barrel[ii-1][i]<=img_threshold&&img_barrel[ii+1][i]>img_threshold&&img_barrel[ii+10][i]>img_threshold)
    {
      mid_end_jizhun.x=ii;
      mid_end_jizhun.y=i;
      mid_end_jizhun_flag=1;
      break;
    }
  }
}

